import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom"

import TemplateDefault from './templates/Default'
import Home from "./pages/Home";
import Checkboxes from "./Checkbox";

const App = () => {
  return (
  <TemplateDefault>
    <Router>
      <Link>
        <Switch>
          <Route>
            <Home />
            <Checkboxes />
          </Route>
        </Switch>
      </Link>
    </Router>
  </TemplateDefault>
  )
}

export default App;
